import BaseController from './BaseController';
import Configuration from 'js/Configuration';
import RODAN_EVENTS from 'js/Shared/RODAN_EVENTS';
import LayoutViewModel from 'js/Views/Master/Main/LayoutViewModel';
import Radio from 'backbone.radio';
import RunJobCollection from 'js/Collections/RunJobCollection';
import ViewRunJob from 'js/Views/Master/Main/RunJob/Individual/ViewRunJob';
import ViewRunJobCollection from 'js/Views/Master/Main/RunJob/Collection/ViewRunJobCollection';
import ViewRunJobCollectionItem from 'js/Views/Master/Main/RunJob/Collection/ViewRunJobCollectionItem';

/**
 * Controller for RunJobs.
 */
export default class ControllerRunJob extends BaseController
{
///////////////////////////////////////////////////////////////////////////////////////
// PUBLIC METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initializes the instance.
     */
    initialize()
    {
        this._runJobLocks = {};
        setInterval(() => this._reacquire(), Configuration.RUNJOB_ACQUIRE_INTERVAL);
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initialize Radio.
     */
    _initializeRadio()
    {
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__RUNJOB_SHOWLAYOUTVIEW, options => this._handleCommandShowLayoutView(options));
        Radio.channel('rodan').on(RODAN_EVENTS.EVENT__RUNJOB_SELECTED, options => this._handleEventItemSelected(options));
        Radio.channel('rodan').on(RODAN_EVENTS.EVENT__RUNJOB_SELECTED_COLLECTION, options => this._handleEventCollectionSelected(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__RUNJOB_ACQUIRE, options => this._handleRequestAcquire(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__RUNJOBS_LOAD, options => this._handleRequestRunJobs(options));
    }

    /**
     * Handle show LayoutView.
     */
    _handleCommandShowLayoutView(options)
    {
        this._layoutView = options.layoutView;
    }

    /**
     * Handle item selection.
     */
    _handleEventItemSelected(options)
    {
        this._layoutView.showItem(new ViewRunJob({model: options.runjob}));
    }

    /**
     * Handle event collection selected.
     */
    _handleEventCollectionSelected(options)
    {
        this._collection = new RunJobCollection();
        this._collection.fetch({data: {project: options.project.id}});
        Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__UPDATER_SET_COLLECTIONS, {collections: [this._collection]});
        this._layoutView = new LayoutViewModel();
        Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__MAINREGION_SHOW_VIEW, {view: this._layoutView});
        var view = new ViewRunJobCollection({collection: this._collection,
                                       template: '#template-main_runjob_collection',
                                       childView: ViewRunJobCollectionItem});
        this._layoutView.showCollection(view);
    }

    /**
     * Handle request acquire.
     */
    _handleRequestAcquire(options)
    {
        // Get lock if available. Else, if we already have the lock, simply open the interface.
        var user = Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__AUTHENTICATION_USER);
        var runJobUrl = options.runjob.get('url');
        if (options.runjob.available())
        {
            var ajaxOptions = {
                url: options.runjob.get('interactive_acquire'),
                type: 'POST',
                dataType: 'json',
                success: (response) => this._handleSuccessAcquire(response, runJobUrl, options.runjob),
                error: () => this._removeRunJobLock(runJobUrl)
            };
            $.ajax(ajaxOptions);
        }
        else if (options.runjob.get('working_user') === user.get('url'))
        {
            var url = this._getWorkingUrl(runJobUrl);
            this._openRunJobInterface(url);
        }
    }

    /**
     * Handle success of interactive acquire.
     */
    _handleSuccessAcquire(response, runJobUrl, runJob)
    {
        this._registerRunJobForReacquire(runJobUrl, response.working_url, runJob.get('interactive_acquire'));
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__RUNJOB_ACQUIRED, {runjob: runJob});
        this._openRunJobInterface(response.working_url);
    }

    /**
     * Opens interface.
     */
    _openRunJobInterface(url)
    {
        window.open(url, '', '_blank');
    }

    /**
     * Registers an interactive job to be relocked.
     */
    _registerRunJobForReacquire(runJobUrl, workingUrl, acquireUrl)
    {
        var date = new Date();
        this._runJobLocks[runJobUrl] = {date: date.getTime(), working_url: workingUrl, acquire_url: acquireUrl};
    }

    /**
     * Get working URL for acquired RunJob.
     */
    _getWorkingUrl(runJobUrl)
    {
        var object = this._runJobLocks[runJobUrl];
        if (object)
        {
            return object.working_url;
        }
        return null;
    }

    /**
     * Handle reacquire callback.
     */
    _reacquire()
    {
        var date = new Date();
        for (var runJobUrl in this._runJobLocks)
        {
            var runJob = this._collection.findWhere({url: runJobUrl});

            // If the RunJob is available, renew. Else, get rid of the lock.
            if (runJob.available())
            {
                var data = this._runJobLocks[runJobUrl];
                if (data)
                {
                    var timeElapsed = date.getTime() - data.date;
                    if (timeElapsed < Configuration.RUNJOB_ACQUIRE_DURATION)
                    {
                        $.ajax({url: data.acquire_url, type: 'POST', dataType: 'json', error: () => this._removeRunJobLock(runJobUrl)});
                    }
                    else
                    {
                        this._removeRunJobLock(runJobUrl);
                    }
                }
            }
            else
            {
                this._removeRunJobLock(runJobUrl);
            }
        }
    }

    /**
     * Remove RunJob lock.
     */
    _removeRunJobLock(runJobUrl)
    {
        this._runJobLocks[runJobUrl] = null;
    }

    /**
     * Handle request RunJobs.
     */
    _handleRequestRunJobs(options)
    {
        this._collection = new RunJobCollection();
        this._collection.fetch(options);
        return this._collection;
    }
}

import $ from 'jquery';
import Backbone from 'backbone';
import BaseController from 'js/Controllers/BaseController';
import Configuration from 'js/Configuration';
import RODAN_EVENTS from 'js/Shared/RODAN_EVENTS';
import Radio from 'backbone.radio';

var oldsync = Backbone.sync;
Backbone.sync = function(method, model, options) { 'use strict'; return oldsync(method, model, options); };

/**
 * Server controller.
 */
export default class ControllerServer extends BaseController
{
///////////////////////////////////////////////////////////////////////////////////////
// PUBLIC METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initializes the instance.
     */
    initialize()
    {
        this._serverDate = null;
        this._server = null;
        this._originalSync = Backbone.sync;
        this._responseTimeout = null;
        this._responsePanic = null;
        this._waitingEventTriggered = false;
        this._pendingRequests = 0;
        Backbone.sync = (method, model, options) => this._sync(method, model, options);
    }

    /**
     * AJAX prefilter associated with server control.
     *
     * This will count the pending responses and set timeouts.
     *
     * @param {object} options object.beforeSend (optional) is a function that takes in the XmlHTTPRequest before sending; this may be useful for doing pre-processing of AJAX requests
     */
    ajaxPrefilter(options)
    {
        var that = this;
        var oldOnBeforeSend = options.beforeSend;
        options.beforeSend = function (xhr) 
        {
            if (oldOnBeforeSend)
            {
                oldOnBeforeSend(xhr);
            }

            // Set a timeout for x seconds.
            if (that._responseTimeout === null)
            {
                that._responseTimeout = setTimeout(() => that._sendWaitingNotification(), Configuration.SERVER_WAIT_TIMER);
            }

            // Set a timeout for panic.
            if (that._responsePanic === null)
            {
                that._responsePanic = setTimeout(() => that._sendPanicNotification(), Configuration.SERVER_PANIC_TIMER);
            }

            // Increment pending requests.
            that._pendingRequests++;
        };
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Sends dummy request to get server time.
     */
    _sendTimeGetterRequest()
    {
        var request = new XMLHttpRequest();
        request.open('HEAD', Configuration.getServerURL());
        request.onreadystatechange = (event) => this._handleTimeRequest(event);
        request.setRequestHeader('Content-Type', 'text/html');
        request.send('');
    }

    /**
     * Sync override. We do this to add handlers.
     */
    _sync(method, model, options)
    {
        options = this._applyAJAXResponseHandlers(options);
        return this._originalSync(method, model, options);
    }

    /**
     * Event bindings.
     */
    _initializeRadio()
    {
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_CONFIGURATION, () => this._handleRequestConfiguration());
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_DATE, () => this._handleRequestDate());
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_LOAD_ROUTES, () => this._getRoutes());
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_LOAD_ROUTE_OPTIONS, () => this._handleGetRouteOptions());
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_GET_ROUTE, routeName => this._handleRequestServerRoute(routeName));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_GET_ROUTE_OPTIONS, options => this._handleRequestServerRouteOptions(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_GET_HOSTNAME, () => this._handleRequestServerHostname());
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__SERVER_GET_VERSION, () => this._handleRequestServerVersionRodan());
    }

    /**
     * Return server config.
     */
    _handleRequestConfiguration()
    {
        return this._server.configuration;
    }

    /**
     * Return server date.
     */
    _handleRequestDate()
    {
        return this._serverDate;
    }

    /**
     * Returns associated route.
     */
    _handleRequestServerRoute(routeName)
    {
        return this._server.routes[routeName].url;
    }

    /**
     * Returns associated route options.
     */
    _handleRequestServerRouteOptions(options)
    {
        return this._server.routes[options.route].options;
    }

    /**
     * Returns server hostname.
     */
    _handleRequestServerHostname()
    {
        return Configuration.SERVER_HOST;
    }

    /**
     * Returns server version - Rodan.
     */
    _handleRequestServerVersionRodan()
    {
        return this._server.version;
    }

    /*
    * Fetches the routes from the Rodan server. This is the first function to be called in the
    * Rodan loading process. It hits the root endpoint on the Rodan server and from there downloads
    * all of the path endpoints required to automatically configure the client application.
    * */
    _getRoutes()
    {
        var routeRequest = new XMLHttpRequest();

        // FYI: the use of the Fat arrow maps `this` to `ServerController`, not the request object.
        routeRequest.onload = (event) =>
        {
            if (routeRequest.responseText && routeRequest.status === 200)
            {
                this._server = JSON.parse(routeRequest.responseText);
                for (var routeName in this._server.routes)
                {
                    this._server.routes[routeName] = {url: this._server.routes[routeName]};
                }
                Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_ROUTESLOADED);
            }
            else
            {
                console.error('Routes could not be loaded from the server.');
                console.error(event);
            }
        };

        routeRequest.open('GET', Configuration.getServerURL(), true);
        routeRequest.setRequestHeader('Accept', 'application/json');
        routeRequest.send();
    }


    /**
     * Fetches the OPTIONS (arguments for sorting, filtering, etc).
     */
    _handleGetRouteOptions()
    {
        for (var key in this._server.routes)
        {
            // Skip routes that don't have any options.
            if (Configuration.ROUTES_WITHOUT_OPTIONS.indexOf(key) >= 0)
            {
                continue;
            }

            var ajaxSettings = {success: (result, status, xhr) => this._handleGetRouteOptionsSuccess(result, status, xhr),
                                type: 'OPTIONS',
                                url: this._server.routes[key].url,
                                dataType: 'json'};
            ajaxSettings = this._applyAJAXResponseHandlers(ajaxSettings);
            var request = $.ajax(ajaxSettings);
            request.key = key;
        }
    }

    /**
     * Handle get route options success.
     */
    _handleGetRouteOptionsSuccess(result, status, xhr)
    {
        this._server.routes[xhr.key].options = result;
    }

    /**
     * Apply success/error AJAX handlers to HTTP request.
     */
    _applyAJAXResponseHandlers(options)
    {
        var genericResponseFunction = (result, status, xhr) => this._handleAJAXResponse(result, status, xhr);

        // Success.
        if (!options.hasOwnProperty('success'))
        {
            options.success = genericResponseFunction;
        }
        else
        {
            var customSuccessFunction = options.success;
            options.success = function(result, status, xhr)
            {
                customSuccessFunction(result, status, xhr);
                genericResponseFunction(result, status, xhr);
            };
        }

        // Error
        if (!options.hasOwnProperty('error'))
        {
            options.error = genericResponseFunction;
        }
        else
        {
            var customErrorFunction = options.error;
            options.error = function(result, status, xhr)
            {
                customErrorFunction(result, status, xhr);
                genericResponseFunction(result, status, xhr);
            };
        }

        return options;
    }

    /**
     * Handle AJAX response (generic).
     */
    _handleAJAXResponse(result, status, xhr)
    {
        // Decrement the pending requests.
        this._pendingRequests--;

        if (document.readyState === 'complete' && this._pendingRequests === 0)
        {
            clearTimeout(this._responseTimeout);
            clearTimeout(this._responsePanic);
            this._responseTimeout = null;
            this._responsePanic = null;
            if (this._waitingEventTriggered)
            {
                this._sendIdleNotification();
            }
        }
        else if (this._waitingEventTriggered)
        {
            Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_WAITING, {pending: this._pendingRequests});
        }

        // Get the time.
        if (xhr.getResponseHeader)
        {
            var dateResponse = new Date(xhr.getResponseHeader('Date'));
            if (this._serverDate === null || this._serverDate.getTime() < dateResponse.getTime())
            {
                this._updateServerDate(dateResponse);
                clearInterval(this._timeGetterInterval);
                this._timeGetterInterval = null;
            }
        }

        // Set Date getter interval.
        if (!this._timeGetterInterval)
        {
            this._timeGetterInterval = setInterval(() => this._sendTimeGetterRequest(), Configuration.SERVER_REQUEST_TIME_INTERVAL);
        }
    }


    /**
     * Sends a notification that queries are still pending.
     */
    _sendWaitingNotification()
    {
        this._waitingEventTriggered = true;
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_WAITING, {pending: this._pendingRequests});
    }

    /**
     * Send idle notification.
     */
    _sendIdleNotification()
    {
        this._waitingEventTriggered = false;
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_IDLE);
    }

    /**
     * Sends a panic notification
     */
    _sendPanicNotification()
    {
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_PANIC);
    }

    /**
     * Handle time getter request response.
     */
    _handleTimeRequest(event)
    {
        var request = event.currentTarget;
        if (request && request.getResponseHeader('Date'))
        {
            var dateResponse = new Date(request.getResponseHeader('Date'));
            if (this._serverDate === null || this._serverDate.getTime() < dateResponse.getTime())
            {
                this._updateServerDate(dateResponse);
            }
        }
    }

    /**
     * Updates recorded server date.
     */
    _updateServerDate(date)
    {
        this._serverDate = date;
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__SERVER_DATE_UPDATED, {date: this._serverDate});
    }
}

import BaseController from './BaseController';
import RODAN_EVENTS from 'js/Shared/RODAN_EVENTS';
import LayoutViewModel from 'js/Views/Master/Main/LayoutViewModel';
import Radio from 'backbone.radio';
import ViewWorkflow from 'js/Views/Master/Main/Workflow/Individual/ViewWorkflow';
import ViewWorkflowCollection from 'js/Views/Master/Main/Workflow/Collection/ViewWorkflowCollection';
import Workflow from 'js/Models/Workflow';
import WorkflowCollection from 'js/Collections/WorkflowCollection';

/**
 * Controller for Workflows.
 */
export default class ControllerWorkflow extends BaseController
{
///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS - Initialization
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Initialize Radio.
     */
    _initializeRadio()
    {
        // Events.
        Radio.channel('rodan').on(RODAN_EVENTS.EVENT__WORKFLOW_SELECTED_COLLECTION, options => this._handleEventCollectionSelected(options));
        Radio.channel('rodan').on(RODAN_EVENTS.EVENT__WORKFLOW_SELECTED, options => this._handleEventItemSelected(options));

        // Requests.
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__WORKFLOW_SAVE, options => this._handleRequestSaveWorkflow(options), this);
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__WORKFLOW_DELETE, options => this._handleCommandDeleteWorkflow(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__WORKFLOW_IMPORT, options => this._handleCommandImportWorkflow(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__WORKFLOW_CREATE, options => this._handleCommandAddWorkflow(options));
        Radio.channel('rodan').reply(RODAN_EVENTS.REQUEST__WORKFLOW_EXPORT, options => this._handleCommandExportWorkflow(options));
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS - Radio handlers
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Handle collection selection.
     */
    _handleEventCollectionSelected(options)
    {
        this._collection = new WorkflowCollection();
        this._collection.fetch({data: {project: options.project.id}});
        Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__UPDATER_SET_COLLECTIONS, {collections: [this._collection]});
        this._layoutView = new LayoutViewModel();
        Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__MAINREGION_SHOW_VIEW, {view: this._layoutView});
        this._viewCollection = new ViewWorkflowCollection({collection: this._collection});
        this._layoutView.showCollection(this._viewCollection);
    }

    /**
     * Handle item selection.
     */
    _handleEventItemSelected(options)
    {
        this._viewItem = new ViewWorkflow({model: options.workflow});
        this._layoutView.showItem(this._viewItem);
    }

    /**
     * Handle command delete workflow.
     */
    _handleCommandDeleteWorkflow(options)
    {
        // Clear the individual view (if there).
        if (this._viewItem !== null && options.workflow === this._viewItem.model)
        {
            this._layoutView.clearItemView();
        }
        options.workflow.destroy({success: (model) => this._handleDeleteSuccess(model, this._collection)});
    }

    /**
     * Handle command add workflow.
     */
    _handleCommandAddWorkflow(options)
    {
        var workflow = new Workflow({project: options.project.get('url'), name: 'untitled'});
        workflow.save({}, {success: (model) => this._handleCreateSuccess(model, this._collection)});
    }

    /**
     * Handle save workflow.
     */
    _handleRequestSaveWorkflow(options)
    {
        options.workflow.save(options.fields, {patch: true, success: (model) => Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__WORKFLOW_SAVED, {workflow: model})});
    }

    /**
     * Handle export workflow.
     */
    _handleCommandExportWorkflow(options)
    {
        options.workflow.sync('read', options.workflow, {data: {export: true}, success: (result) => this._handleExportSuccess(result, options.workflow)});
    }

    /**
     * Handle import workflow.
     */
    _handleCommandImportWorkflow(options)
    {
        var fileReader = new FileReader();
        fileReader.onerror = (event) => this._handleFileReaderError(event);
        fileReader.onload = (event) => this._handleFileReaderLoaded(event, options.project);
        fileReader.readAsText(options.file);
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS - FileReader handlers
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Handle FileReader error.
     */
    _handleFileReaderError(event)
    {
        // TODO error
        console.error(event);
    }

    /**
     * Handle FileReader loaded.
     */
    _handleFileReaderLoaded(event, project)
    {
        var workflow = new Workflow({project: project.get('url'), serialized: JSON.parse(event.target.result)});
        workflow.save({}, {success: (model) => this._handleImportSuccess(model, this._collection)});
    }

///////////////////////////////////////////////////////////////////////////////////////
// PRIVATE METHODS - REST handlers
///////////////////////////////////////////////////////////////////////////////////////
    /**
     * Handle create success.
     */
    _handleCreateSuccess(model, collection)
    {
        collection.add(model);
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__WORKFLOW_CREATED, {workflow: model});
    }

    /**
     * Handle delete success.
     */
    _handleDeleteSuccess(model, collection)
    {
        collection.remove(model);
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__WORKFLOW_DELETED, {workflow: model});
    }

    /**
     * Handle export success.
     */
    _handleExportSuccess(result, model)
    {
        var data = JSON.stringify(result);
        Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__DOWNLOAD_START, {data: data, filename: model.get('name'), mimetype: 'application/json'});
    }

    /**
     * Handle import success.
     */
    _handleImportSuccess(model, collection)
    {
        collection.add(model, {});
        Radio.channel('rodan').trigger(RODAN_EVENTS.EVENT__WORKFLOW_CREATED, {workflow: model});
        //Radio.channel('rodan').request(RODAN_EVENTS.REQUEST__WORKFLOWBUILDER_VALIDATE_WORKFLOW, {workflow: model});
    }
}

